import React, { useState } from 'react';
import Header from './Header';
import Footer from './Footer';
import Creat from './Creat';
import Note from './Note';
import './keep.css';


const Keep = () =>{
    const [cb,setcb] = useState([]);
    const hola = (a)=>{
        setcb((nala)=>{
            [cb,...nala];
        });
    }
    return(
        <>
        <div className='keepMain'>
            <Header />
            <Creat tmacin={hola}/>
            <Note/>
            <Footer />
        </div> 
        </>
    );
};
export default Keep;
